('1371685965', 'new page', 'About Us', 'about-us', '', 'The concept of Ad It Up Tees is not so much different from many other online t-shirt stores. There are many places for you to shop for graphic tees, and there are many places for you to design your own custom tee, however, Ad It Up Tees is the place where you can get both. We have a wide selection of graphic tees, as well as the ability to customize and create your own apparel, all from the convenience of your home. All of our products are &ldquo;made to order,&rdquo; in which you can customize according to what colors you like to wear.<br />\n<br />\nWe have our own production facility which specializes in many different printing techniques. We use the latest technologies in garment printing, as well as traditional methods. We have always loved the idea of &ldquo;no minimum printing,&rdquo; which lets you have custom items without having to pay for extra you do not need. With that said, we also have the capacity to print for your biggest size jobs. We really hate the idea of having to charge extra fees, so never worry about that. The price you see is the price you pay, and we will even ship everything for free.<br />\n<br />\nThank you very much!', 'Yes', 'No', 'No', 'Jun 19 2013', 'display'),
('1371686012', 'new page', 'Return Policy', 'return-policy', '', 'Lets face it. Sometimes with online purchases, you may not be satisfied with your purchase when you receive the items. We are happy to refund purchases on graphic tees within 30 days of your purchase. These returned items must be in new condition. This means items that are not washed or deemed unsaleable.<br />\n<br />\nIf you designed a custom tee, unfortunately, we can not accept returns or give refunds on merchandise that is custom created.<br />\n<br />\nYou will need to get a Return Authorization number (RA number) before sending back your items. Please remember to do so before sending in your items, that way we can avoid any confusion and get your return processes quickly. To get an RA number, please fill out this form.', 'Yes', 'No', 'No', 'Jun 19 2013', 'display'),
('1371686035', 'new page', 'Delivery Information', 'delivery-information', '', 'We offer free standard shipping on all items to the lower 48 states. Hawaii and Alaska usually incur a small added fee, so we ask that you send us an email before placing your order if you are shipping to HI or AK. Unfortunately, we do not ship internationally.<br />\n<br />\nTypically, you can expect your order to ship within two days, and shipping times&nbsp; vary depending on the location. We will send you the tracking number as soon as your order ships.', 'Yes', 'No', 'No', 'Jun 19 2013', 'display'),
('1371686056', 'menu link', 'News', 'news', '', '', 'Yes', 'No', 'No', 'Jun 19 2013', 'hide'),
('1371686073', 'new page', 'Contact Us', 'contact-us', '', 'Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat. Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi.<br />\r\n<br />\r\nNam liber tempor cum soluta nobis eleifend option congue nihil imperdiet doming id quod mazim placerat facer possim assum. Typi non habent claritatem insitam; est usus legentis in iis qui facit eorum claritatem. Investigationes demonstraverunt lectores legere me lius quod ii legunt saepius. Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum. Mirum est notare quam littera gothica, quam nunc putamus parum claram, anteposuerit litterarum formas humanitatis per seacula quarta decima et quinta decima. Eodem modo typi, qui nunc nobis videntur parum clari, fiant sollemnes in futurum.', 'Yes', 'No', 'No', 'Jun 19 2013', 'display'),
('1371686096', 'new page', 'Privacy Policy', 'privacy-policy', '', '<strong>What information do we collect?</strong><br />\nWe collect information from you when you register on our site or place an order. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address, phone number or credit card information. You may, however, visit our site anonymously.<br />\n<br />\n<strong>What do we use your information for?</strong><br />\nAny of the information we collect from you may be used in one of the following ways:<br />\nTo process transactions\n<ul>\n	<li>\n		Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.</li>\n</ul>\nTo send periodic emails\n<ul>\n	<li>\n		The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.</li>\n</ul>\n<strong>How do we protect your information?</strong><br />\nWe implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.<br />\n<br />\nWe offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to?keep the information confidential.<br />\n<br />\nAfter a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be kept on file for more than 60 days.<br />\n<br />\n<strong>Do we use cookies?</strong><br />\nYes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information<br />\n<br />\nWe use cookies to compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.<br />\n<br />\nIf you prefer, you can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies via your browser settings. Like most websites, if you turn your cookies off, some of our services may not function properly. However, you can still place orders over the telephone or by contacting customer service.<br />\n<br />\n<strong>Do we disclose any information to outside parties?</strong><br />\nWe do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.<br />\n<br />\n<strong>Third party links</strong><br />\nOccasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.<br />\n<br />\n<strong>California Online Privacy Protection Act Compliance</strong><br />\nBecause we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We therefore will not distribute your personal information to outside parties without your consent.<br />\n<br />\n<strong>Childrens Online Privacy Protection Act Compliance</strong><br />\nWe are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.<br />\n<br />\n<strong>Your Consent</strong><br />\nBy using our site, you consent to our web site privacy policy.<br />\n<br />\n<strong>Changes to our Privacy Policy</strong><br />\nIf we decide to change our privacy policy, we will post those changes on this page.', 'No', 'Yes', 'No', 'Jun 19 2013', 'display'),
('1371686117', 'new page', 'Terms and Conditions', 'terms-and-conditions', '', 'Your use of adituptees.com is regulated terms and conditions set. Please read the following information carefully. By using this site or submitting an order for products or services, you indicate your acceptance of, and agreement to be bound by, the terms and conditions set forth below. If you do not agree to these terms and conditions, please do not use this site and please do not submit any orders for products or services.<br />\n<br />\nThese terms and conditions may be changed by Ad It Up in the future. It is your responsibility as a user to periodically return to this page to review the terms and conditions for amendments. The amended terms shall take effect automatically the day they are posted on the site. Your continued use of the adituptees.com following any amendments will constitute agreement to such amendments.<br />\n<br />\n<strong>Payment Options:</strong> We accept VISA, MasterCard, Discover, American Express, Diners Club, JCB, personal checks, company checks, money orders, cashiers checks, and company purchase orders on approved credit. Sales tax is collected only on shipments to New Mexico. All prices on the adituptees.com site are quoted in U.S. currency and all orders must be transacted in the same.<br />\n<br />\n<strong>Prices &amp; Availability:</strong> Because of the fast-moving nature of our industry, prices and availability are subject to change without notice. If a product is not in stock when you place your order (for example, not yet available or sold out), we will do our best to let you know and to let you know when we anticipate the product will be available. Anticipated delivery dates are dependent upon vendor supplies and other factors and are subject to change.<br />\n<br />\n<strong>Unauthorized or Refused Returns:</strong> Ad It Up will not accept unauthorized returns or exchanges. Packages without a Return Authorization Number will be refused upon return to our warehouse. Additional charges may apply if the merchandise is not returned in 100% complete condition in the original packaging. To complete a return, you must call an Ad It Up customer service representative to obtain an RA (Return Authorization) number before returning your product to Ad It Up. For faster service, please have the following information ready when calling for an RA number: Customer name, order number, item number and the reason for return.<br />\n<br />\n<strong>Defective Returns:</strong> Defective returns will be accepted for exchange or repair, at our discretion, within 30 days from the shipment date. No refunds or credit will be granted after 30 days. A product must be diagnosed &quot;defective&quot; by a member of staff at the manufacturer. All non-product-related fees (shipping and handling fees) are not refundable.<br />\n<br />\n<strong>Returns of Custom Products:</strong> Any item that is non-defective, but has been embellished in any way is non-returnable, or non refundable.<br />\n<br />\n<strong>Typographic, Photographic &amp; Technical Errors:</strong> Although we do our best to achieve 100% accuracy, occasionally errors &amp; inaccuracies do occur. Should you encounter an error or inaccuracy, please inform us so it can be corrected. Products &amp; packaging depicted may differ from stock available at time of shipment. We reserve the right to substitute equivalent items. However, if artwork submitted is incorrect, and the item has been proofed and approved by the customer, Ad It Up is not responsible for refunding, or correcting the error.<br />\n<br />\n<strong>Warranty Disclaimer and Limitations on Liability:</strong> ADITUPTEES.COM PASSES THROUGH TO ITS CUSTOMERS ALL MANUFACTURERS&sup1; WARRANTIES AND GUARANTEES THAT ARE PROVIDED FOR THE PRODUCTS IT SELLS. ADITUPTEES.COM MAKES NO ADDITIONAL OR INDEPENDENT WARRANTIES. TO THE FULL EXTENT PERMISSIBLE BY APPLICABLE LAW, adituptees.COMDISCLAIMS ALL WARRANTIES, EXPRESS OR IMPLIED, INCLUDING, BUT NOT LIMITED TO, IMPLIED WARRANTIES OF MERCHANTABILITY AND FITNESS FOR A PARTICULAR PURPOSE.<br />\n<br />\nADITUPTEES.COM SHALL UNDER NO CIRCUMSTANCES BE LIABLE FOR SPECIAL, INCIDENTAL, CONSEQUENTIAL (INCLUDING LOST PROFITS OR OPPORTUNITIES) OR PUNITIVE DAMAGES, EVEN IF IT HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. THE MAXIMUM LIABILITY OF AD IT UP FOR ALL DAMAGES SHALL BE LIMITED TO AN AMOUNT NOT TO EXCEED THE PURCHASE PRICE OF THE PRODUCT. LIKEWISE, AD IT UP WILL NOT BE LIABLE FOR ANY DAMAGES OF ANY KIND ARISING FROM THE USE OF ITS CATALOG OR WEB SITE, INCLUDING, BUT NOT LIMITED TO DIRECT, INDIRECT, INCIDENTAL, PUNITIVE AND CONSEQUENTIAL DAMAGES. AD IT UP MAKES NO WARRANTY AS TO THE PERFORMANCE OF ANY MERCHANDISE SOLD. WE ARE NOT RESPONSIBLE FOR SYSTEM DOWNTIME, LOST DATA, ETC. THIS DISCLAIMER BY AD IT UP IN NO WAY AFFECTS THE TERMS OF ANY APPLICABLE MANUFACTURERS&sup1; WARRANTIES OR GUARANTEES. AD IT UP IS NOT RESPONSIBLE FOR GOODS THAT ARE DAMAGED THOUGH POSTAL SERVICES.<br />\n<br />\n<strong>Disputes:</strong> Any claims against Ad It Up relating in any way to your purchases from adituptees.com shall be submitted to confidential arbitration in Albuquerque, New Mexico. Arbitration under this agreement shall be conducted under the rules then prevailing of the American Arbitration Association. The arbitrator&sup1;s award shall be binding and may be entered as a judgment in any court of competent jurisdiction. To the fullest extent permitted by applicable law, no arbitration under this Agreement shall be joined to an arbitration involving any other party subject to this Agreement, whether through class arbitration proceedings or otherwise. In any such arbitration, the parties shall be responsible for their own costs, expenses and attorney&sup1;s fees. [This clause can be made more specific concerning the method and manner of dispute resolution.] In the event that this arbitration provision is unenforceable, any litigation regarding this agreement or any transaction between the customer and Ad It Up shall be brought in the state or federal courts located in Albuquerque, New Mezico and the customer hereby agrees and submits to such jurisdiction and venue as exclusive and proper.<br />\n<br />\n<strong>Governing Law:</strong> Transactions between you and Ad It Up, and any disputes arising between you and Ad It Up related to any interaction between you and Ad It Up, including but not limited to claims relating to the content of its catalogs and Web site, shall be governed by and construed in accordance with the laws of the State of California without regard to the laws regarding conflicts of law. If any provision of this agreement shall be unlawful, void or for any reason unenforceable, then that provision shall be deemed severable from this agreement and shall not affect the validity and enforceability of any remaining provisions.<br />\n<br />\n<strong>Title - Risk of Loss:</strong> Title to items being purchased passes from adituptees.com to purchaser at the time of shipping. Customer takes on full liability for safety and validity of delivery address given to us at the time of purchase. Ad It Up will not incur any forwarding costs on shipments. Ad It Up shall not be responsible for damages or delays resulting from Acts of God, war, riot, seizure, terrorist activities, embargo or other acts or events outside of the reasonable control of Ad It Up.<br />\n<br />\n<strong>Return Procedures:</strong> The RA Number. Any product returned will be credited the lower of the purchase price or current price plus and restock fees. No return will be accepted without a return authorization (RA) number. To request a RA number, please contact an Ad It Up Customer Service Specialist Toll Free at (866) 792-0389. RA numbers are valid for ten business days after issue. Your RA number(s) must appear clearly on the shipping label of the return shipment. Affix a label to the box: PLEASE DO NOT MARK THE BOX ITSELF IN ANY